import React from 'react'
import PropTypes from 'prop-types'
import 'bootstrap/dist/css/bootstrap.min.css';

const Button = ({text, color, onClick}) =>{
    <Button
        onClick = {onClick}
        style = {{backgroundColor: color}}
        className = "btn btn-primary"
    >
        {text}
    </Button>
}
